/* Model creation/destruction functions */

void MODEL_mkTb::create_model(tSimStateHdl simHdl, bool master)
{
  sim_hdl = simHdl;
  init_reset_request_counters(sim_hdl);
  mkTb_instance = new MOD_mkTb(sim_hdl, "top", NULL);
  bk_get_or_define_clock(sim_hdl, "CLK");
  if (master)
  {
    bk_alter_clock(sim_hdl, bk_get_clock_by_name(sim_hdl, "CLK"), CLK_LOW, false, 0llu, 5llu, 5llu);
    bk_use_default_reset(sim_hdl);
  }
  bk_set_clock_event_fn(sim_hdl,
			bk_get_clock_by_name(sim_hdl, "CLK"),
			schedule_posedge_CLK,
			NULL,
			(tEdgeDirection)(POSEDGE));
  (mkTb_instance->INST_mma_m_a_memory.set_clk_0)("CLK");
  (mkTb_instance->INST_mma_m_a_serverAdapter_outData_ff.set_clk_0)("CLK");
  (mkTb_instance->INST_mma_m_a_serverAdapter_outData_enqw.set_clk_0)("CLK");
  (mkTb_instance->INST_mma_m_a_serverAdapter_outData_dequeueing.set_clk_0)("CLK");
  (mkTb_instance->INST_mma_m_a_serverAdapter_cnt_1.set_clk_0)("CLK");
  (mkTb_instance->INST_mma_m_a_serverAdapter_cnt_2.set_clk_0)("CLK");
  (mkTb_instance->INST_mma_m_a_serverAdapter_cnt_3.set_clk_0)("CLK");
  (mkTb_instance->INST_mma_m_a_serverAdapter_writeWithResp.set_clk_0)("CLK");
  (mkTb_instance->INST_mma_m_a_serverAdapter_s1_1.set_clk_0)("CLK");
  (mkTb_instance->INST_mma_m_b_memory.set_clk_0)("CLK");
  (mkTb_instance->INST_mma_m_b_serverAdapter_outData_ff.set_clk_0)("CLK");
  (mkTb_instance->INST_mma_m_b_serverAdapter_outData_enqw.set_clk_0)("CLK");
  (mkTb_instance->INST_mma_m_b_serverAdapter_outData_dequeueing.set_clk_0)("CLK");
  (mkTb_instance->INST_mma_m_b_serverAdapter_cnt_1.set_clk_0)("CLK");
  (mkTb_instance->INST_mma_m_b_serverAdapter_cnt_2.set_clk_0)("CLK");
  (mkTb_instance->INST_mma_m_b_serverAdapter_cnt_3.set_clk_0)("CLK");
  (mkTb_instance->INST_mma_m_b_serverAdapter_writeWithResp.set_clk_0)("CLK");
  (mkTb_instance->INST_mma_m_b_serverAdapter_s1_1.set_clk_0)("CLK");
  (mkTb_instance->INST_mma_m_c.set_clk_0)("CLK");
  (mkTb_instance->INST_test_fsm_start_wire.set_clk_0)("CLK");
  (mkTb_instance->INST_test_fsm_start_reg_2.set_clk_0)("CLK");
  (mkTb_instance->INST_test_fsm_abort.set_clk_0)("CLK");
  (mkTb_instance->INST_test_fsm_state_set_pw.set_clk_0)("CLK");
  (mkTb_instance->INST_test_fsm_state_overlap_pw.set_clk_0)("CLK");
  (mkTb_instance->INST_test_fsm_state_fired_1.set_clk_0)("CLK");
  (mkTb_instance->set_clk_0)("CLK");
}
